INSERT INTO `about` (`id`, `title`, `metaTitle`, `metaKeywords`, `metaDescription`, `heading`, `content`) VALUES
(1, 'Hop On Hop Off Barcelona© | Barcelona Bus Tour | Barcelona Bus Turistic', '', 'barcelona hop on hop off, barcelona bus turistic, barcelona hoho, barcelona bus tour, barcelona bus city tour, barcelona city sightseeing, barcelona bus sight, barcelona city bus tour, hop on hop off barcelona, city sightseeing barcelona', 'Book! Barcelona Hop-On, Hop-Off Bus Tour online at the lowest price. Save 12%  on Barcelona City Bus Tour offers mind-blowing opportunities to explore the insight of the city. 12 months validity ticket.', '<h1 style=\"text-align: center; \"><span style=\"font-size: 24px;\">﻿</span><u><span style=\"font-size: 24px;\" titillium=\"\" web\";=\"\" font-size:=\"\" 24px;\"=\"\" web\";\"=\"\"><b>Barcelona Hop-On Hop-Off Bus Tour</b></span></u></h1>', '<p>Barcelona, one of the prettiest cities in Spain, is the largest and the capital city of the Catalonia region and second most populous in the country. A trip to Spain is not complete without visiting Barcelona. The hills and the sea make the perfect view for this city, and the Antoni Gaudi’s dotting masterpieces all over the place adds class to it. Barcelona offers some of the best Wine and dines offer globally, and the mesmerizing architecture of the city will put one in awe. This city formed under the Roman Empire, during the medieval ages. Barcelona played an important role in shaping up administration during that time and has been the capital of Catalonia since.\r\n</p><p>\r\nEnjoy the best view of the city from the cliffs or the mountain ranges. One can see the whole city with beautiful architectural gems bordering the deep endless sea. To witness few of Gaudi’s work visit La Sagrada Familia, Casa Mila, Park Guell, and Casa Batllo. The cobblestone streets and the gothic architecture will give one a medieval vibe for sure. To know more about the Catalonian history and culture, do visit the Sant Andreu district of Barcelona. Feel like a true Barcelonian with a glass of sweet aromatic Vermouth wine with a great Spanish brunch.\r\n\r\n</p>');
