(1, '<p class=\"MsoNormal\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n107%;font-family:\"Titillium Web\";mso-ansi-language:EN-US\">City Sightseeing Barcelona:\r\nHop-On Hop-Off Bus Tour (Bus Turistic)<o:p></o:p></span></b></p>', '<ul type=\"disc\">\r\n <li class=\"MsoNormal\" style=\"line-height: normal;\"><b><span style=\"font-size:12.0pt;font-family:\" titillium=\"\" web\";mso-fareast-font-family:=\"\" \"times=\"\" new=\"\" roman\";mso-bidi-font-family:\"times=\"\" roman\";mso-fareast-language:=\"\" en-in\"=\"\">Flexible Ticket! You can use your Barcelona Hop-On, Hop-Off ticket any day within 12 months.</span></b></li>\r\n <li class=\"MsoNormal\" style=\"line-height: normal;\"><b><span style=\"font-size:12.0pt;font-family:\" titillium=\"\" web\";mso-fareast-font-family:=\"\" \"times=\"\" new=\"\" roman\";mso-bidi-font-family:\"times=\"\" roman\";color:#ce0000;=\"\" mso-fareast-language:en-in\"=\"\">Book Now! Tickets are available from 01st\r\n     April 2021 onwards.</span></b><span style=\"font-size:12.0pt;font-family:\r\n     \" titillium=\"\" web\";mso-fareast-font-family:\"times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" \"times=\"\" roman\";mso-fareast-language:en-in\"=\"\"><o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"line-height: normal;\"><span style=\"font-size:12.0pt;font-family:\" titillium=\"\" web\";mso-fareast-font-family:=\"\" \"times=\"\" new=\"\" roman\";mso-bidi-font-family:\"times=\"\" roman\";mso-fareast-language:=\"\" en-in\"=\"\">Specially formulated 3 bus routes across the city to provide the\r\n     best experience.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"line-height: normal;\"><span style=\"font-size:12.0pt;font-family:\" titillium=\"\" web\";mso-fareast-font-family:=\"\" \"times=\"\" new=\"\" roman\";mso-bidi-font-family:\"times=\"\" roman\";mso-fareast-language:=\"\" en-in\"=\"\">With the high frequency of Buses, don’t worry about queues even in\r\n     the peak season<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"line-height: normal;\"><span style=\"font-size:12.0pt;font-family:\" titillium=\"\" web\";mso-fareast-font-family:=\"\" \"times=\"\" new=\"\" roman\";mso-bidi-font-family:\"times=\"\" roman\";mso-fareast-language:=\"\" en-in\"=\"\">Discount of up to 250€ to enjoy Barcelona at its best<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"line-height: normal;\"><span style=\"font-size:12.0pt;font-family:\" titillium=\"\" web\";mso-fareast-font-family:=\"\" \"times=\"\" new=\"\" roman\";mso-bidi-font-family:\"times=\"\" roman\";mso-fareast-language:=\"\" en-in\"=\"\">Internet all time on board with free Wi-Fi service.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"line-height: normal;\"><span style=\"font-size:12.0pt;font-family:\" titillium=\"\" web\";mso-fareast-font-family:=\"\" \"times=\"\" new=\"\" roman\";mso-bidi-font-family:\"times=\"\" roman\";mso-fareast-language:=\"\" en-in\"=\"\">Pre-recorded audio commentary available in 16 languages<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"line-height: normal;\"><b><span style=\"font-size:12.0pt;font-family:\" titillium=\"\" web\";mso-fareast-font-family:=\"\" \"times=\"\" new=\"\" roman\";mso-bidi-font-family:\"times=\"\" roman\";mso-fareast-language:=\"\" en-in\"=\"\">Mobile and Paper vouchers both are accepted on this tour.</span></b><span style=\"font-size:12.0pt;font-family:\" titillium=\"\" web\";mso-fareast-font-family:=\"\" \"times=\"\" new=\"\" roman\";mso-bidi-font-family:\"times=\"\" roman\";mso-fareast-language:=\"\" en-in\"=\"\"><o:p></o:p></span></li>\r\n</ul>', '<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify;text-justify:inter-ideograph;line-height:150%\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:150%;font-family:\"Titillium Web\";\r\nmso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:\"Times New Roman\"\"><span style=\"font-size: 12pt;\">Barcelona\r\nis the heart of Spain adorned with some of the most appreciated beautiful\r\nplaces. This cosmopolitan centre comprises of the atmosphere that still recites\r\nthe story of medieval ages. This Barcelona hop-on hop-off bus tour offers mind-blowing\r\nopportunities to explore the insight of the city in one go. This tour comprises\r\nof three routes that reach to every single corner and spot of the city. The\r\nblend of historical culture like Gothic Culture and the natural beauty like\r\nMediterranean Beaches gives the compact idea of the surprise that Barcelona\r\nholds in its lap.</span><o:p></o:p></span></p>', '<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify;text-justify:inter-ideograph;line-height:150%\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:150%;font-family:\" titillium=\"\" web\";=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";mso-bidi-font-family:\"times=\"\" roman\"\"=\"\">Hop\r\non the bus that is ready to step towards the streets of Barcelona.&nbsp;</span><span style=\"color: rgb(51, 51, 51); font-size: 12pt;\" titillium=\"\" web\";=\"\" font-size:=\"\" 12pt;=\"\" text-align:=\"\" left;\"=\"\">On\r\nthis hop-on hop-off bus tour of Barcelona, you have the freedom to plan your\r\nown sightseeing itinerary.&nbsp;</span><span style=\"font-family: \" titillium=\"\" web\";=\"\" font-size:=\"\" 12pt;\"=\"\"><span style=\"font-size: 12pt;\">This\r\nwelcoming city has a lot much to discover. Prioritized with 3 different\r\nroutes </span><b><span style=\"font-size: 12pt;\">Red, Blue, </span></b><span style=\"font-size: 12pt;\">and</span><b><span style=\"font-size: 12pt;\"> Green</span></b><span style=\"font-size: 12pt;\"> Lines, the hop on bus tour has something special on\r\neach path.</span></span></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify;text-justify:inter-ideograph;line-height:150%\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:150%;font-family:\" titillium=\"\" web\";=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";mso-bidi-font-family:\"times=\"\" roman\"\"=\"\"><span style=\"font-size: 12pt;\">Initially,\r\nthe bus will start from the Red Line where it will travel towards the\r\nCatalonian culture and allow you to know the functioning of the world in that\r\nzone. On this line, you will encounter </span><b><span style=\"font-size: 12pt;\">Estació de Sant, Plaça d\'Espanya, Plaça\r\nde Catalunya,</span></b><span style=\"font-size: 12pt;\"> and </span><b><span style=\"font-size: 12pt;\">Passeig de Gràcia - La Pedrera</span></b><span style=\"font-size: 12pt;\"> and will get mesmerized with\r\nthe brilliant infrastructure. While exploring through the Red Line, you will\r\ncome to an end of this journey where you will be visiting the antiquated Gothic\r\nCorner that comprises of </span><b><span style=\"font-size: 12pt;\">Museu Nacional d\'Art de Catalunya, Poble Espanyol,\r\nColom - Museu Marítim, Fundació Joan Miró,</span></b><span style=\"font-size: 12pt;\"> and </span><b><span style=\"font-size: 12pt;\">Museu d\'Història de Catalunya</span></b><span style=\"font-size: 12pt;\">.</span><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify;text-justify:inter-ideograph;line-height:150%\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:150%;font-family:\" titillium=\"\" web\";=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";mso-bidi-font-family:\"times=\"\" roman\"\"=\"\">While\r\nyou will be replaying the whole seen in your mind, the hop-on tour will be ready\r\nto load you with a new mind-blowing experience. The bus will take you on Blue\r\nLine where you will discover the brilliant artwork of <b>Antoni Gaudi</b>. After\r\nreaching the destination, you will get surprised by glaring at the <b>Gràcia,\r\nPalau Reial,</b> and <b>Park Güell</b>. While you will be recording everything in your\r\ncamera you will catch the view of the Gorge on the way of <b>Sagrada Familia</b> that\r\nis also work of <b>Antoni</b>. On the Blue Line, there is a surprise for football\r\nlovers. The bus will hop towards the <b>Barcelona Football Club (FCB)</b>.<o:p></o:p></span></p><p><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:\" titillium=\"\" web\";=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";mso-bidi-font-family:\"times=\"\" roman\";=\"\" mso-ansi-language:en-us;mso-fareast-language:en-us;mso-bidi-language:ar-sa\"=\"\">Before\r\nending the tour, the bus will hop on the Green Line towards the <b>Mediterranean\r\nBeaches</b>. After a busy day, the tour will take you to the calm place of the\r\ncity. Get along the shores, enjoy the view, capture the sunset, breath in the\r\nfreshness of the beach and collect lots of unforgettable memories. While\r\nstanding on the beach gaze at the district 22 embellished with modern building\r\nand leading technology companies of the cosmos.</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><span style=\"font-size:12.0pt;font-family:&quot;Titillium Web&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;\r\ncolor:#333333;mso-fareast-language:EN-IN\">With the choice of 1-day and 2-day\r\nticket, you can explore fabulous Barcelona city at your own pace. The Barcelona\r\nBus Turistic Hop-on Hop-off bus covers </span><span style=\"font-size: 12pt; font-family: &quot;Titillium Web&quot;; color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">all of the popular landmarks and attractions.</span><span style=\"font-size: 12pt;\"> With a\r\nmultilingual pre-recorded commentary, you will cover below major attractions:</span><span style=\"font-size:12.0pt;font-family:&quot;Titillium Web&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;color:#333333;mso-fareast-language:\r\nEN-IN\"><o:p></o:p></span></p><ul style=\"margin-top:0cm\" type=\"disc\">\r\n <li class=\"MsoNormal\" style=\"color: rgb(51, 51, 51); margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><b><span style=\"font-size:12.0pt;font-family:&quot;Titillium Web&quot;;\r\n     mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;\r\n     mso-fareast-language:EN-IN\">Sagrada Familia<o:p></o:p></span></b></li>\r\n <li class=\"MsoNormal\" style=\"color: rgb(51, 51, 51); margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><b><span style=\"font-size:12.0pt;font-family:&quot;Titillium Web&quot;;\r\n     mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;\r\n     mso-fareast-language:EN-IN\">Park Güell<o:p></o:p></span></b></li>\r\n <li class=\"MsoNormal\" style=\"color: rgb(51, 51, 51); margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><b><span style=\"font-size:12.0pt;font-family:&quot;Titi