ess mr-2\"></i> <span>Free Wi-Fi on-board</span></li>\r\n\r\n                    <li><i class=\"fa fa-check fa-sm text-success mr-2\"></i> <span>Coupon booklet with more than 250€ in promotional discounts</span></li>\r\n\r\n                   </ul>', '<ul class=\"list-unstyled\">\r\n\r\n<li><i class=\"fa fa-times fa-sm text-danger mr-2\"></i> <span>Entrance Fee</span></li>\r\n\r\n                    <li><i class=\"fa fa-times fa-sm text-danger mr-2\"></i> <span>Meals</span></li>\r\n\r\n                    <li><i class=\"fa fa-times fa-sm text-danger mr-2\"></i> <span>Hotel Transfers</span></li>\r\n\r\n\r\n                  </ul>', '<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><u><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\">Ticket Redemption Information:</span></u></b><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\">You can board the bus at any stop and voucher can\r\nbe exchanged directly with the driver<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\">Mobile and paper printed vouchers are both accepted\r\nat all stops<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\">Your Ticket is valid for 1 year from the booking\r\ndate.</span></b><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\"> <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><u><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\">Additional Information:</span></u></b><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\">Wheelchair access with manual ramp<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\">Pets are not allowed on the buses<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\">Infants (under 4 yrs) can travel free and you do\r\nnot require to book infant ticket.</span></b><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\"> <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><u><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\">Operational Details:</span></u></b><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><u><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\">Barcelona Hop-On, Hop-Off:</span></u></b><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\">Season:</span></b><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\"> All\r\nyear round except 01 January, 25 December<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\">Green Line:</span></b><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\"> The\r\nGreen line is operational in summer only (03 April to 01 November)<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\">First Tour:</span></b><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\"> 9:00am, <b>Last\r\nTour:</b> 8:00pm (Summer) / 7:00pm (Winter) from <b>Plaça de\r\nCatalunya</b><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\"> <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><u><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\">Information for Cruise Passengers:</span></u></b><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\">Stop 15, World Trade Center</span></b><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\">, and <b>Stop 16, Colom\r\n- Museo Marítim, </b>on the Red Line are the closest bus stops\r\nto the port.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size: 12pt; font-family: \"Titillium Web\";\">The port runs a shuttle service which takes\r\npassengers to the closest stops; for more information, please ask at the\r\ninformation desk in the Cruise Port Terminal.</span></p>', 'INR', '<p><b><span style=\"font-size: 12pt; line-height: 107%; font-family: \" titillium=\"\" web\";=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\">No cancellation charges </span></b><span style=\"font-size: 12pt; line-height: 107%; font-family: \" titillium=\"\" web\";=